"insert into MasterData values ( '1','flat','Na Folimance 21','Prague','cz','113300','2017-07-02','1','EUR','Two-bedroom apartment is located in the beautiful Prague district Vinohrady. Near the apartment of 62 square meters sprawls Folimanka park with a sports hall, which can be reached in three minutes. At the other end of the park you will discover one of the few places in Prague where are preserved medieval walls built by Charles IV. You can also feel the history at nearby Vyšehrad castle, the entrance gate to the fort is 10 minutes walk away. In three minute you walk to Theatre Na Fidlovačce, a little further is also Theater Bez Hranic.
