"insert into MasterData values ( '11','flat','U Letenského sadu 14','Prague','cz','143500','2017-09-06','1','EUR','This beautiful apartment is located in Prague district Holešovice. Near the flat spreads park Letenské sady with tennis courts and a statue of Prague Metronome, from where you can enjoy a beautiful view of the river Vltava. If you go the other direction you will get to another popular park - Stromovka. In a minute you walk to the National Technical Museum with old airplanes, motorcycles or veterans. Sports fans can catch a football game at the stadium Generali Arena, in five minutes you also get to the cinema and Bio Oko.
The location is easily accessible by public transport. In three minutes you get to trams 1, 2, 6, 7, 8, 12, 13, 14, 25, 26, 41, 51, 56 and 57, which take you in a few minutes to metro line C.
In the vicinity of the apartment is a supermarket, post office, pharmacy and ATMs, as well as cafés, restaurants and bars.

Spacious apartment is very nicely furnished, you will fall in love with the flat in the moment you cross the doorstep. Living room with hardwood floors offers a comfortable sofa from which you can watch TV, as well as table with chairs and a library. Two separate bedrooms are equipped with large double bed and wardrobe, the bigger one also offers a sofa-bed, computer and a television. The third bedroom is cleverly hidden behind a sliding door of frosted glass that separate the room from the spacious kitchen. The kitchen is so well equipped, that you could prepare here a feast for the whole family! While cooking you will appreciate electric stove with a kitchen hob, oven or microwave. Because of the dishwasher, you don´t have to worry about the dirty dishes anymore.
