"insert into MasterData values ( '13','flat','Seifertova 447/53','Prague','cz','135900','2017-06-01','1','EUR','This spacious apartment is located in the beautifil neighborhood of Žižkov in central Prague. It is easily accessible by public transport, a minute-walk takes you to the tram 5, 9, 15, 26, 55 and 58. By the tram you get in three minutes to Central Station where you can transfer to green metro line A. Nearby apartment also stop buses 133, 175, 207 and 509.
In a moment you get to the path to the Žižkov TV tower or to the Vitkov National Memorial, which is surrounded by a large park. In the same street you can find restaurants, cafes and bistros, as well as wellness center with fitness or language school teaching Czech for foreigners. Football fans will be thrilled by the vicinity of the football stadium Victoria Zizkov.

Once you enter the apartment with balcony, you will find yourself in the hallway with a shoe rack. From the hall you get to the bedroom decorated in white and green colors with large double bed from which you can watch TV. The bedroom is also equipped with built-in wardrobe.
Over the dining table you will discover kitchenette with electric stove, which helps you to cook lunch or dinner. Small snack can be warmed up in the microwave, coffee can be prepared at the coffeemaker. 
