"insert into MasterData values ( '22','flat','Vlhká 172/16','Brno','cz','52900','2017-07-02','1','EUR','Cozy apartment in the district of Zábrdovice east of the historic city center, can be found on the fourth floor of a historical building. Just next to your new home is Malinovské náměstí with Mahen Theater, which is protected as a cultural monument.
