"insert into MasterData values ( '45','flat','Na Folimance 21','Prague','cz','94400','2017-05-29','1','EUR','One-bedroom apartment is located in the beautiful Prague district Vinohrady. Near the apartment sprawls Folimanka park with a sports hall, which can be reached in three minutes. At the other end of the park you will discover one of the few places in Prague where are preserved medieval walls built by Charles IV. You can also feel the history at nearby Vyšehrad castle, the entrance gate to the fort is 10 minutes walk away. In three minute you walk to Theatre Na Fidlovačce, a little further is also Theater Bez Hranic.
The location is easily accessible by public transport. The red metro line C is 9 minutes away, nearby stops tram 1, 2, 3, 4, 5, 6, 7, 11, 12, 13, 14, 16, 17, 18, 20, 21, 24, 25, 52 and 56.
