"insert into MasterData values ( '57','flat','Na Skalce 13','Prague','cz','83100','2017-08-18','1','EUR','Spacious apartment is located on the left bank of the Vltava River in Prague district Smíchov. Nearby spreads the Mrázovka Park with the classical villa Bertramka, where lived Wolfgang Amadeus Mozart. In the second direction you will discover Santoška Park with a picturesque view of the world's most beautiful city. Within a 10-minute walk you will find the functionalist Smíchov Synagogue. Not far from it is the shopping center Nový Smíchov, where you can find something nice to wear, watch a film in a cinema or play bowling. Sport fans will appreciate vicinity of the Winter Stadium Nikolajka, fitness center or yoga.
The location is easily accessible by public transport. The tram lines 1, 4, 5, 7, 9, 10, 12, 15, 16, 20, 21, 54, 58 and 59 about two-minutes walk away. Yellow metro line B (station Anděl) can be reached in 10 minutes, and Bus Station Na Knížecí is also nearby.
During your walks around you will find restaurants, cafes and bars, as well as grocery store, post office, ATM and pharmacy.

The bright apartment is located on the third floor of a newly renovated historic building dating back to 1895. Once you cross the threshold of the apartment with high ceilings, you will find yourself in a long hallway leading to each room. The door on your right hand will take you to the bedroom with a comfy double bed. Against it stands a desk that can serve as a home office.
In the living room you will also find a kitchenette and a wooden dining table. Below the window overlooking the park there is a comfortable sofa where you can nestle yourself with a book in your hand or watch your favorite movie on TV. The white kitchen is really spacious. While cooking, you can use the oven or built-in gas cooker with a kitchen hood. Quick breakfast can be prepared with a toaster, snack or dinner can be warmed up in the microwave. 
In the apartment you will find a second bedroom with a single bed and also an extra bed, so the room is suitable for two people. You can put your clothes in the wardrobe or chest of drawers, in the morning you can check your emails at the desk.
White bedroom features a washing machine and a bathtub, where you can relax after a busy day.

