"insert into MasterData values ( '58','flat','Dětská 2600/238','Prague','cz','125900','2017-06-02','1','EUR','Are you looking for a quiet home near the city center? If so, this is the right place for you. This two-storey house with a large garden is located in Prague district Strašnice in a quiet street with a lot of green and full of terraced houses. In this street you won't meet crowds of tourists like in the center of Prague. Location is easily accesible by public transport. Tram stops of numbers 5, 7, 13, 51, 55, 58 and 59 are only 5 minutes walk away. Also bus stops of numbers 154, 175, 188, 506 and 609 and station of green line metro A are very close. You will get to Wenceslas Square in 10 minutes!
Around the house you can find everything you need. Supermarkets and shops, restaurants, pizzeria, pharmacy, post, drugstore and ATMs are available nearby. You can visit Theatre X10 or play tennis on nearby tennis courts. You can also walk to the Church of the Immaculate Conception of the Virgin Mary and admire its unconvenial architecture.

Open the wooden gate, walk through the garden with blooming roses, take the handle and you will find yourself in a spacious ground floor of the house. The door on the left leads to well equiped light kitchen. There you can find a gas cooker, oven, microwave or a dishwasher. The kitchen is also equipped with large fridge with freezer.
The ground floor features a living room with beautiful dark wood furniture. In the middle of the room stands a large dining table, patio doors leads to the garden with outdoor furniture under the apple trees, where you can spend warm summer evenings. In winter you can warm up in a bath full of hot water in a romantic white-pink bathroom with washing machine.
