The apartment overlooks the inner quiet green courtyard.
Near to house located a great  playground for kids. 
The Old Town Square is 5 minutes by subway.
200 metres away is the church of St. Ludmila, the church of the Sacred Heart, The Vinohrady heatre, and the Riegrovy Sady park. 
Transfer to and from Prague Airport and the main railway station can be organized upon guest’s request.
