"insert into MasterData values ( '71','flat','Hybešova 22','Brno','cz','66100','2017-05-27','1','EUR','This beautiful apartment with underfloor heating is located in Old Brno. After eight-minute walk you will find yourself at the foot of the hill, which features Spilberk Castle, surrounded by a popular park. In 10 minutes you can also reach the Cathedral of Saints Peter and Paul, one of the dominant of Brno, which you may also know from the Czech ten crown coin. Nearby there is also Moravian Gallery, in front of which you will find a former secret atomic shelter, where you can go to a sightseeing tour, art exhibition or enjoy a milkshake in the dairy bar. Fresh vegetables, herbs or flowers can be found within 10 minutes on square Zelný trh. Sports fans will surely appreciate the proximity of the DRFG Arena, where hockey matches, as well as concerts take place.
