"insert into MasterData values ( '83','flat','Jahodová 121','Prague','cz','73600','2017-07-02','1','EUR','3+1 apartment in a calm part of the city with a great connection to the centre (day and night). Suitable for 4-6 people - a group of friends or family with kids.

It consists of two bedrooms, a living room, entrance room, kitchen and a separate shower and toilet. It is spacious, cosy, well equipped (washing mashine, fridge, freezer, vacuum cleaner,...) and near to all kinds of services. Wi-fi included.

Smoking on the balcony is allowed.

The name of the neighborhood - ""Zahradní město"" - means ""Garden City"" and it is as green as it sounds. Although it's an estate, there are trees and grass areas all around. See the pictures!

WHAT CAN YOU FIND IN THE NEIGHBORHOOD?

SHOPPING: Literally one minute walking from here you can find a little shopping centre “OC Cíl“ with Albert supermarket and a few smaller shops: stationery shop, haberdashery, pet shop, flower shop, cake shop, café, restaurant and other services. Five minutes from here there is a bigger mall, “OC Hostivař“ (https://vivo-shopping.com/cs/hostivar), where there is a bigger offer of shops and also a big cinema complex.

FOOD: If you want to grab a meal outside, we recommend either “Garden City“ (http://www.gardencityrestaurant.cz/) or “U Švehly“ (http://www.u-svehly.cz/). 

BEER: Our most favorite pub to go out for a beer is so called “Malina“ (“Raspberry“, because it‘s on Raspberry street - did you know that all the streets around here are named by plants and flowers?) (http://restauracevmalinove.cz/) with a nice beergarden right next to a newly reconstructed park. Sometimes we take the tram and go to a bar called “Vesna“ (http://barvesna.cz/).

WINE: Wine cellar by the “Hamr“ pond – it feels like being in the country :) (http://www.kalshawine.cz/).

NATURE: 15 minutes by public transport from the apartment you can find the “Hostivař Forest Park“ (https://goo.gl/maps/VQ1G2ufUTUp).

KIDS: In walking distance: “Jasmínka Café“ with a playroom (http://www.kavarnajasminka.cz/) or above mentioned park/playground in Malinová (https://goo.gl/maps/WUPEqr1Nu8S2). If you spend a few minutes on public transport, you can visit a traditional farm “Toulcův dvůr“ (http://www.toulcuvdvur.cz/) or go the other way and visit “Gutovka“ centre, where you can find for example skatepark, boulder wall and minigolf (http://www.gutovka.cz/).

SPORT: Court rentals for all kinds of sports, but also yoga and aerobic lessons at “Hamr“ ( http://www.hamrsport.cz). Above mentioned “Gutovka“ is more outdoor though.

