A short walk from the apartment is also the Flora shopping center where there is a supermarket ATM, pharmacy, drugstore, clothing shops and an IMAX theater.
The location is also easily accessible by public transport. In 5 minutes by walk you will get to the underground line A Flora, from where you reach the Old Town Square in less than 10 minutes.
In the surroundings is also the tram stop (1, 5, 8, 9, 10, 11, 13, 15, 16, 25, 26, 51, 52, 55, 58) and bus stop (136, 175).
For your visit awaits you restaurants, bars, cafes and bistros, nearby also stands post office.
