"insert into MasterData values ( '103','flat','Bělehradská 76','Prague','cz','69900','2017-06-01','1','EUR','This one bedroom apartment can be found in the most beautiful part of Prague called Vinohrady.
Near the house dating from 1182, you will find many beautiful corners. Nearby you can find Havlíčkovi Orchards, which surround  renaissance Villa Gröbe, with picturesque views over the city.
In the neighborhood you will also find the D21 theater and the Municipal Library in Prague, the Church of St. Ludmila is only 5 minutes away. The neo-Gothic gem is located on the Square of Peace, where you will find the underground line A.
If you will walk in the opposite direction from the apartment, you will get to the underground line C (I.P.Pavlova).
Get to the tram stop (6, 11, 13, 56) is even easier, you can take the tram only a minute after you lock the door behind you.
