"insert into MasterData values ( '126','flat','Kaiser-Ebersdorfer-Straße 26','Vienna','at','139600','2017-05-24','1','EUR','This one-bedroom apartment is located in the part of Vienna called Simmering, where it abounds with tourists.
Get to the center it takes only 10 minutes! Neighborhood of the apartment hides a lot of interesting places which you can discover during your stay.
Sport fans can enjoy a match of American football at nearby stadium Vienna Vikings.
Stretch your muscles you can in the nearby fitness center, where you can play squash, run on the treadmill or just go to the sauna.
By walk you can get also to the Renaissance castle Neugebäude or to the church consecrated to St. Charles Boromejskému  with a beautiful dome that shows the the starry heavens.
If you're traveling with your family, you can take the kids to a nearby park Löwygrube where they can take a ride on the carousel or bumper cars. 
The apartment is very well accessible by public transportation. In 5 minutes by walk you get to the underground line U3, which will take you directly to the center.
Next to the underground line you also find a tram stop (6, 71). If you will arrive by car, you find the parking spaces in the yard behind the house.
In the vicinity of the apartment you can find restaurants, bars and pubs, where you can jump on tank beer. A few minutes away you find also a supermarket, pharmacy, ATM or gas station.

The Apartment on the second floor is decorated in the contrast of light and dark colors. 
Into the bedroom with a comfortable double bed you will get across the floor in shades of wood. In the evening, you can watch your favourite movies on the TV mounted on the opposite wall.
