"insert into MasterData values ( '129','flat','Masná 5','Prague','cz','262700','2017-05-24','1','EUR','Tento krásný loftový apartmán najdete v samotném srdci historické Prahy. Za deset minut se dostanete ke Klementinu s jednou z nejkrásnějších knihoven světa, kousek od něj začíná i slavný Karlův most. Za pět minut od zabouchnutí dveří můžete stát i na Staroměstském náměstí pod odbíjejícím Pražským orlojem. Ještě blíže stojí třeba Španělská synagoga s působivým interiérem.
Lokalita je výborně dostupná městskou hromadnou dopravou. Stanice Staroměstská metra linky A je vzdálená 8 min, pokud se vydáte druhým směrem, dojdete za stejnou dobu i k metru linky B. Přímo za rohem staví i autobus 194, v okolí je ale i několik tramvajových zastávek.
Na Vaši návštěvu čekají v sousedství restaurace, hospůdky, kavárny a bary, najdete zde ale i potraviny, galerie a divadla. 

Moderní dvoupatrový byt je zařízený v odstínech teplých barev. Ve spodním patře objevíte obývací pokoj s rozkládací pohovkou, ze kterému můžete sledovat televizi. Dřevěná kuchyň nabízí plynový sporák, mikrovlnnou troubu, lednici s mrazákem i kávovar a toastovač. Ráno si u jídelního stolu pochutnáte na báječných míchaných vajíčkách s opečeným toastem a čerstvou kávou. Po schodech, pod kterými najdete šatní skříně se zrcadly, vyjdete do ložnice. Na parketové podlaze zde stojí dvě pohodlné manželské postele.
