"insert into MasterData values ( '135','flat','Humboldtplatz 10','Vienna','at','110000','2017-10-17','1','EUR','Sunny one bedroom apartment can be found in part of Vienna called Favoriten, near Keplerplatz with beautiful Neo-Renaissance Church of St. John the Evangelist (Keplerkirche).
Around this square leads shopping streetwhere you will find everything from restaurants and cafes across pharmacy and ATMs up to supermarket and clothing stores.
If you are more fans of traditional markets, you can visit Viktor-Adler-Markt which is situated only few minutes away and buy fresh vegetables, fruits, meat, fish or pastries.
Nearby is also worth to see the Belvedere Palace, which is known for its extensive collection of art. 
If you've ever feel desire to see with your own eyes Kiss by Gustav Klimt, this is the place for you!
The baroque palace is surrounded by a park, which hides a botanical garden right next to you will find a park Schweizergarten with the 21er Haus, a museum of contemporary art.
If you are more fans of sports, you can go for a swim in Amelienbad, one of the nicest pools in Vienna.
The apartment is easily accessible by public transport. Just on 4 minutes by walk you will get to the underground line U1, which takes you into the center of Vienna.
The main station is only 10 minutes away. Nearby the apartment stands tram stop (6, 18, 67, O).

Newly renovated apartment on the second floor looks very cozy and homely. The bedroom has very good space solution and so it's also used as a living room.
Up the stairs you will get to the bed, which is in fact elevated, so there is plenty of space and a comfortable sofa with a coffee table. 
Two large windows overlooking the park, bringing the light into the room. 
The bright kitchen is very well equipped, without any problem you will be able to prepare also the famous Wienerschnitzel.
Into the kitchen unit is built-in electric hob with the hood, oven and also a dishwasher. 
