"insert into MasterData values ( '139','flat','U Vršovického nádraží 159/12','Prague','cz','83300','2017-05-30','1','EUR','This beautiful apartment can be found in the Prague district Vršovice. In three minutes you walk to park Havlíčkovy sady with Gröbeho villa, surrounded by vineyards. In the park with stunning views of the city you will discover an artificial stalactite cave Grotta. Sports enthusiasts can enjoy a football match at the Stadium Bohemians 1905, which is within a five minute walk. In 10 minutes you can also reach the functionalist church of St. Wenceslas by architect Josef Gočár.
The location is easily accessible by public transport. Tram stops 2, 4, 5, 6, 7, 13, 21, 24, 52 and 55 is just a one minute walk. Metro line C can be reached in 10 minutes by tram. Even access to the train is very good, you get to the Vršovice Station in three minutes.
There are restaurants, cafes and bars as well as a post office, pharmacy, supermarket or gas station.

