"insert into MasterData values ( '142','flat','Pekařská 4','Brno','cz','90600','2017-07-03','1','EUR','This beautiful apartment is situated in the historical centre of Brno. Just three hundred meters from your apartment is Gothic St. Peter and Paul Cathedral, one of the greatest dominants of Brno. Ten minutes away from your apartment is the castle and fortress Špilberk, which was built in the 13th century. In the park, that surrounds Špilberk, you can take your pet, which is allowed by the owner, for a walk. However you are still in the city center, so the pubs, bars or clubs are waiting for your visit.
Your new home is a close to all services - in three minutes you walk to public institutions such as the Municipality, as well as countless number of shops, restaurants, pharmacies. Five minutes' walk away is St. Anne's Hospital. In 10 minutes you will reach the historic center and square Náměstí Svobody.
Apartment is well accesible by public transport, although everything important can be reached by foot. Directly below the apartment are two tram stops – one for trams 5 and 6 and the other for tram 12, which ends up in the Technology park, the new centre of information technology. Ten minutes’ walk also takes you to the two biggest transport hubs - Česká and Main Station.

