"insert into MasterData values ( '153','flat','Školská','Prague','cz','85000','2017-05-31','1','EUR','Semi detached house with a small garden in the front and a concrete area and a garage in the back. One car can be parked in the garage, another one in the backyard, and also parking in the street is free of charge.

