"insert into MasterData values ( '163','flat','Na Bělidle 302/27','Prague','cz','77400','2017-08-10','1','EUR','Tento krásný byt se nachází na Smíchově, v centru Prahy. Nedaleko něj stojí novorenesanční bazilika zasvěcená svatému Václavovi nebo Smíchovská synagoga. Příjemnou procházkou dojdete i rozlehlého parku, který obklopuje Letohrádek Kinských. 
Doslova za rohem stojí Anděl, oblíbené nákupní středisko, ve kterém seženete vše, na co jen pomyslíte. Zajít si sem můžete na nákupy nebo třeba do kina. Pokud nemáte rádi velká nákupní centra, nevadí. V sousedství najdete obchody a obchůdky všeho druhu, restaurace, bary, kavárny nebo lékárny. Anděl je také důležitý dopravní uzel. Staví tu metro linky B, tramvaje číslo 4, 5, 7, 9, 10, 12, 15, 16, 20, 21, 54, 58, 59 a autobusy 123, 167, 191 a 501. Odsud se zkrátka dostanete všude!

Jednopokojový byt s kuchyňským koutem je laděn do dřeva. Odstíny světlého a tmavého dřeva se tu střídají všude, a byt tak působí příjemným a uceleným dojmem. Hlavní místností je ložnice s velikou postelí, do které se budete každý večer rádi vracet. Kdyby Vám místo nestačilo, můžete si rozložit i pohovku. V rohu místnosti na Vás čeká designový psací stůl, u kterého bude radost pracovat. Celou místnost krásně osvětluje veliké okno. Vedle najdete dobře vybavený kuchyňský kout s jídelním stolkem. Příjemný dojem bytu stvrzuje i bílá koupelna se sprchovým koutem.

