"insert into MasterData values ( '167','flat','Václavská 16','Prague','cz','151000','2017-07-09','1','EUR','The space

The apartment has 2 bedrooms, living room, kitchen, toilet and bathroom. One bedroom is with a king-size bed, the other with a sofa bed which can be turned into a queen-size bed. Suitable for 4 guests. Living room is equipped with leather sofa, TV and a large dining table. Modern kitchen is fully equipped with appliances (stove, oven, dishwasher, fridge, freezer) and all cooking and dinning ware. Bathroom is equipped with bath tub and shower. Washing machine is at your disposal.

Apartment is located on the second floor of the building and there is elevator available for guest.

Guest access

Whole apartment

Interaction with guests

Will meet with guest when check in. I can help to provide necessary info about Prague during the guest's stay.

The neighborhood

The apartment is located on the the back side of the square. It's nice and quiet street, ideal for guest to rest. The neighborhood is packed with all kinds of dinning options, breakfast, brunch, lunch and dinner, from genuine Czech food to Asian style food. I am more than happy to share those options with our guests.

Getting around

The apartment is located around 2 minutes walk to the metro and tram stop Karlovo namesti. Detail walking route will be provided once confirmed booking.

Ticket for public transportation can be purchased in the convenient stores in the airport, train station and bus station. Recommend to buy the 36 CZK single ticket to get to the apartment for the first time. I will provide more info about public transportation once guests arrive.

From the airport:

By taxi, there is AAA taxi available in the airport. It takes you around half an hour from the airport to the apartment.
By public transport, take bus 100 from both terminals to the final stop Zlicin, exchange to metro line B at Zlicin, it takes you directly to Karlovo namesti.

From the train station:
By taxi, It takes you around 10-15 minutes to the apartment.
By metro, take the metro C line from the main station (hlavni nadtrazi) to Florenc (the direction of Letnany). Exchange at Florenc to metro line B towards Karlovo namesti (the direction of Zlicin).

From bus station Florenc
By taxi, It takes you around 10-15 minutes to the apartment.
By metro, take the metro B line from Florenc to Karlovo namesti (the direction of Zlicin).

If you come by car, there is paid underground parking near the apartment and paid parking at Charles square (Karlovo namesti). PLEASE DO NOT PARK THE CAR IN THE RESIDENTIAL ZONES (marked by blue lines in the streets) - your car would get towed away by the police.','50.0747328','14.4177011','0','50000','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGZT/JtdUZNYlJBcXJ3M2hVZytIU2RwOXNj/TmppYjBSTUJvR21hM2s5cHNKUi9iM1/N6RDM1a2xqMSsyVCtTcHZMQU5mV3NQ/QjkvdUp2TGYyWVo3TVBaQ289.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGWU/1Wb1dScTRvRTJZVjd4cmJidXVFRlZk/SjZyUVRDUUtLbGJqenFYd0dGUHo2OG/9tWExnMXg4ZklPVDkxOGp3cFJiWkVX/c1YyOTVBZ2V6TnB2TlBoMzA9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGV2/xPMHRXdWtWUGc1c1duK3ZVVWNoeHly/VEo1R0h4cHdneVFJRlZPZXVHcjJESF/IzN002T0tXY09VdDFGNmtKS0x3UkNZ/a1RaU3VFN21lVHRaY3RqN0k9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGVV/RmWDNGWExlVUR0d3JpWFBxRWZWVHN6/c0tLVnhGYW1QUHZNVjlDRklNSzN1Y3/pEeWdaZ25mNWdjRGF4bnptSitOcy9w/YmYvZUMzb0pBbjVaeWlESHc9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGU1/NITVJuT1JmYS9WU0Y5Q3hPUGtQVXpt/cVlUVGZ5UmkvM29MQ2JrY1VBMUxLTD/lSK1UzbUF0MklFRExXWU1ZdlFqTnBS/SlRNR2ZSV2ZKMHlKZmNGTFU9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGVD/FEMHR3U1ZMeFg4NXRmWmRRSFhGbWdY/aldha2JWZmtFSUh0aGRjWU5lUjlnUF/p2cDVaR3NjUmN3MWlBRjk2dHplZjFq/MHFTUTdGM0dmeXlHekdnTnM9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGVW/w3cHdrM01kVHlWc1dkM3cydTNveHNF/M0NvKzkxY0J1WkJFN3FvTEEydFY4OW/tGM2tIdnBJZjhzRXZ5Z28yUHpHYmZj/RTZ5MFZkRFNmR3VweUYydmc9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGVV/M3cGl5TURZOVpmOVdmWktKT2ZZOXJY/MDJ6QlllbVBnMVpHdkppZ1RiS1hmNm/p3VW1rLzM1aVZwQWROMkhKMTFqdFYv/TlpVc2ZsTDVyQ05RZWFidlU9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGVm/11aEZRYUM1NnQ2NmlKeVhYYjJYbFEw/SGNUc2lCOXFnaWQwN2d1YW1menVjS0/5rU05ZSWpUVjk1bkdsWXFpbEZDYzhN/bXg1cFk2cmZDZGpHcWdLV1E9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2F