"insert into MasterData values ( '168','flat','Seifertova 447/53','Prague','cz','135900','2017-06-01','1','EUR','This spacious apartment is located in the beautifil neighborhood of Žižkov in central Prague. It is easily accessible by public transport, a minute-walk takes you to the tram 5, 9, 15, 26, 55 and 58. By the tram you get in three minutes to Central Station where you can transfer to green metro line A. Nearby apartment also stop buses 133, 175, 207 and 509.
