"insert into MasterData values ( '176','room','Vlašimská 1876/13','Prague','cz','49100','2018-01-01','1','EUR','We offer a private room with attached balcony at Vila Flora community house. There is a large double bed, a sofa bed, a small table, large wardrobe and entrance to spacious balcony. The balcony is overlooking our garden and houses around. The toilet is only a few steps away from the room. The bathroom with large bath is shared with other people and located one floor above your private room in a common attic. You can use shared kitchen, office space, garden, library and living room during your stay.


About the house

It is a charming historical villa in a peaceful green neighborhood of Prague 10, located 10 minutes from the city center by metro or tram. Villas around were build by the writers community in the 1920s. Around the corner you can have a look at the house of one of our most famous writers Karel Čapek.


Guest access

You can use a well­ equipped kitchen and dining room, which are shared with us. You can use blender, professional food processor and spiralizer, which are ideal for preparation of smoothies, raw treats or vegan food. The villa is surrounded by a beautiful lush garden with flowers, herbs and vegetables. It´s always available for you to relax after your Prague explorations.


Interaction with Guests

Vila Flora is a community house run by people who desire a more harmonic world. You can become part of our community for a while, get inspired and healed by our healthy snacks. There is always someone around to give you information about the neighborhood or Prague.


The Neighborhood

Vila Flora is situated in the area of Vinohrady, where you can experience the real Prague life and meet locals, but you are very close to the city centre. The closest neighbourhood of Vila Flora is very quiet, but in 5 minutes walking distance you get to the main street where you find a big shopping mall, cafes, restaurants, bars, etc. The range of options is great: Czech food, international cuisine, organic/vegetarian food, farmers´market, cozy cafes, big clubs, alternative music bars... We can be in daily contact and give you information about the best places in Prague.


Getting Around

In 5 minutes by foot you get to Flora - metro, bus and tram station. It takes only 10 minutes to the city center from there.


Other Things to Note

You can reach the Vila in 45 minutes by public transport from the airport. We offer a pick up service at the airport for 1200 CZK/car or 300 CZK/public transport. You can send us inquiry for other routes. You can use the washing machine for 5Eur per one load or we can do your laundry for 10Eur/each.

We have a little home cafe at Vila Flora. You are invited to explore tastes of raw vegan snacks both sweet and salty (vegan & fermented) and the crispy freshness of the salads from our garden.

You can ask us about workshops or lectures on topics like earthships, self-sufficiency, raw food, fermentation, kombucha, microgreens, community life, etc.

