"insert into MasterData values ( '179','flat','Milady Horákové 322/10','Brno','cz','62300','2017-07-17','1','EUR','This one-bedroom apartment is located in the very center of Brno. After three minutes, you will reach Janáček's theater, which is surrounded by a pleasant park with a light fountain, whose shapes and colors are particularly impressive after nightfall. Gothic Church of St. George is a 7-minute walk away, as well as the Moravian Square with the Baroque Místodržitelský Palace, where you will find the Moravian Gallery today. There is also the popular Cinema Scala on the square, where you can enjoy not only films, but also lectures and discussions organized by Masaryk University.
The location is easily accessible by public transport. Tram stop of lines 1, 3, 5, 6 and 9 and night lines 90, 91, 92 and 93 is three minutes away. If you are traveling by car, you can park for free in front of the house.
Nearby you will find restaurants, cafes and bars as well as theaters, galleries, groceries, pharmacies or ATMs. The landlord also lives in the same house, so he can advise you where to go for a good coffee or beer.

The cozy studio is decorated in bright colors, contrasting nicely with dark parquet floors. In the morning you wake up in a comfortable double bed, which is separated from the rest of the apartment by a wall. You will heat up the pan on an electric stove, take a couple of eggs out of the frige-freezer and break them into the pan. The kitchenette is also equipped with an oven and a microwave. In the bright bathroom you will enjoy a refreshing shower and when you go out, a wonderful breakfast is waiting for you. You can enjoy it on the sofa-bed while watching morning news on TV.
Beneath the window overlooking the garden stands a desk that may serve as a home office. There is also enough storage space - a spacious wardrobe and a pantry.

