On your visit in the neighborhood await stores, shops, restaurant or a cafes, right around the corner you will find a bakery, grocery, pharmacy or ATMs.
One of the advantages of the apartment is a very good accessibility. Nearby is a tram stop (4, 22, 59) and bus stop (124, 139).
If you prefer driving a car, you will appreciate even free parking near the apartment.

