Opposite the bedroom you will discover the living room with kitchenette. The hob with a designer hood, oven and dishwasher are built into the wooden kitchen unit.
Behind the bar is hiding sofa with two comfortable armchairs from which you can watch TV.
The window of the living room leads into the street and overlooks the beautiful decorated historic homes.
