"insert into MasterData values ( '212','flat','Bořivojova 40','Prague','cz','90600','2017-05-29','1','EUR','Avoid the crowds of tourist and get the feel of the real Prague. Explore living neighbourhood - Žižkov with many bistros and bars. Relax in a cozy and modern apartment.

The house is located in a living and safe neighbourhood less than 10 minutes from the downtown.
The apartment is completely new and fully equipped. If you are looking for a cozy aparment for a good value, this shall be your choice.

The studio has one double bed, large wardrobe, a table prepared for your snack, litlle sofa and a kitchenette which is fully equipped.

Fast WiFi connection is in the whole apartment.

The apartment is located in a living district called Zizkov know for numerous pubs/restaurants/bars with reasonable prices dispersed over the district. Just about 400 meters far from the apartment there is a famous Zizkov TV tower which provides best view of Prague. The surroundings are nice - although you are 10 minutes from downtown (Wenceslas square) there are 2 parks in the vicinity. Also a popular music club Akropolis is just few minutes from the apartment. Next to the house there is a Grocery store so it's extemely easy to buy anything instantly.

The apartment is close to tram and metro (green/red) stops so it will be very easy for you to travel around 
the city. The apartment is also just 2 tram stops away from the main railway station which gives a great opportunity make trips out of Prague over the entire Czech Republic.

Great for food lovers! 
If you would prefer buying food to cooking, you also have many opportunities: 
Farm markets on Jirak (the square not even 8 minute by walk from the apartment), every Wednesday & Friday and every Saturday.
Antonin´s Bakery – handmade traditional bakery, 5 minutes by walk.

Pho Vietnam – one of the best Vietnamese bistro (in my opinion the best!) in Prague.
And a lot of others:)

The underground line (Jiřího z Poděbrad) is 8 minutes by walk away from the apartment. It is 10 minutes to the centre. 
The tram stop is also 2 minutes away from the apartment. 
The center (Wenceslas Square) is about 20 minutes by walk.
