insert into MasterData values ( '216','flat','','Prague','cz','98200','2018-01-01','1','EUR','Útulné studio č.9 v rezidenčním domě hotelového typu s příjemnou privátní atmosférou, nabízející krátkodobý i dlouhodobý pronájem v prostředí dobře udržovaného původního bytového činžovního domu z počátku 20. století. Nachází se na výhodném a dobře dostupném místě v těsné blízkosti klíčových dopravních uzlů Prahy 5, vedle velkého obchodního a administrativního centra Zlatý Anděl, kde jsou dostupné všechny druhy městské hromadné dopravy (PID) včetně bezprostřední blízkosti vstupu do metra. Dům nabízí dvoulůžková a jednolůžková studia (1+kk, 30m2) s možností přistýlky, situovaná cca na úrovni 2. patra, vybavená vším, co je potřeba při cestování, kratším či delším pobytu i stálém bydlení: kuchyňská linka včetně spotřebičů - sporák, lednice, mikrovlnka, koupelna s toaletními potřebami, WC, sprchovým koutem i vysoušečem vlasů. Každé studio má připojení Wi-Fi k internetu a LCD televizi. Na přání zákazníka lze zajistit každodenní úklid studia i další služby (praní, žehlení). Domácí zvířata jsou dovolena (pes, kočka). Dům je veden jako nekuřácký. Kuřácký dvorek v zadním traktu budovy je pro tento účel kdykoliv k dispozici.','50.0688104','14.4017142','0','50000','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGUl/l0cFFIWFo2aFBlcGpITmUzcTlCMjgy/L2NPUVZ3NUFObWdzaWhLZlpoTTFIT3/g3dUVJV005dnZkMnRBbEcyY2g2Z3Zl/aEpaKzlhbmdIWDVSaXZKRVU9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGUX/ZkeEhVWWQrcHFORlVXMEpmT2Rzcm9y/L2ZyNFZoU0U2TElzNnFlNHJrMlh4Q1/lzMGJOWHRoc1NPd1d1QmtjTTA1cEJY/ZTZyQzBXWkZKdzBQekI5L2M9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGYW/U5QVZWNHFkK3Z4M2drY1hDVEE4MDVX/TGVOMUgyNTUwVVJWSk5tLzlLRnRVb0/dHWFplZDlXUi9lOE1VQkZrT1lBSUJR/SVdTNitLTGdNaE5VZ2ZreTQ9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGZG/htWlJtaE0yazl5aW1DenFHK2piTVVX/UVdhVlhjUEY4MCt1cG5HMVlKWnBFUW/ZvbVdMd2dHdzY1cSthcEFnQXFRT0FO/dGhnTjZrNEVHaXJ0eFAxSms9.jpg