"insert into MasterData values ( '231','flat','Hroznová 493/5','Prague','cz','188800','2017-05-24','1','EUR','Beautiful attic apartment with a view overlooking the Charles Bridge is located a short walk from the Vltava river and is located in one of Prague's oldest districts, in Lesser Town. You can feel the history of your new home where the owner, after a gentle reconstruction, preserved parts of original 17th-century floors and wooden ceilings with decorative beams.
