"insert into MasterData values ( '240','flat','Máchova 19','Prague','cz','169900','2017-05-24','1','EUR','This beautiful and spacious apartment can be found in the part of Prague called Vinohrady.
When wandering around you will certainly find Havlíčkovi orchards with Villa Gröbe surrounded by vineyards, 
which offers a beautiful view of the most beautiful city in the Old Continent. 
In less than 10 minutes by walk you will get to the Peace Square (Náměstí Míru), dominated by a neo-Gothic Church of St. Ludmila.
From here you will reach the center by the underground line A in a few minutes. Nearby the apartment are also a tram stop (1, 4, 10, 16, 22, 51, 57, 59) and bus stop (135).
On your visit awaits you also nearby located restaurants, bars, cafes and wine bars. 
In the neighborhood you can also find ATM machines, grocery, post office and pharmacy, on a tournament of fantasy and sci-fi desk games you can jump into the nearby venue.
The evenings can be spent in the cinema cafe.

This whole apartment is located on the first floor of a newly renovated historic building.
Decoration of the apartment in bright colours makes the apartment very spacious. 
The largest room of the apartment is the living room with a kitchenette. From the comfortable sofa you can watch the evening news on television, glass door leads onto the balcony overlooking the courtyard.
The kitchen is very well equipped, so you can easily cook every day. The electric hob with the hood, oven or microwave will help you with it.
Each day starts with a good cup of coffee and breakfast, so that´s why awaits you also a coffee maker and toaster. Worries from dirty dishes fall away, just simply put them into the dishwasher!
From the living room will go through into the bedroom with a double bed. Opposite the window you will find built-in wardrobes with large storage space, a little farther stands a chest of drawers.
