insert into MasterData values ( '280','flat','','Prague','cz','98200','2018-01-01','1','EUR','Útulné studio č.7 v rezidenčním domě hotelového typu s příjemnou privátní atmosférou, nabízející krátkodobý i dlouhodobý pronájem v prostředí dobře udržovaného původního bytového činžovního domu z počátku 20. století. Nachází se na výhodném a dobře dostupném místě v těsné blízkosti klíčových dopravních uzlů Prahy 5, vedle velkého obchodního a administrativního centra Zlatý Anděl, kde jsou dostupné všechny druhy městské hromadné dopravy (PID) včetně bezprostřední blízkosti vstupu do metra. Dům nabízí dvoulůžková a jednolůžková studia (1+kk, 30 m2) s možností přistýlky, situovaná cca na úrovni 3. patra, vybavená vším, co je potřeba při cestování, kratším či delším pobytu i stálém bydlení: kuchyňská linka včetně spotřebičů - sporák, lednice, mikrovlnka, koupelna s toaletními potřebami, WC, sprchovým koutem i vysoušečem vlasů. Každé studio má připojení Wi-Fi k internetu a LCD televizi. Na přání zákazníka lze zajistit každodenní úklid studia i další služby (praní, žehlení). Domácí zvířata jsou dovolena (pes, kočka). Dům je veden jako nekuřácký. Kuřácký dvorek v zadním traktu budovy je pro tento účel kdykoliv k dispozici.','50.0688104','14.4017142','0','50000','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGYz/ZtQ2VISUpQSG54YmxiWmxmRHZBNmMx/bi90emtOUnBic0J3T2FESU1GZEg5Wk/5keWowdTJwNFJibFRDOXdXQ2djcWVy/Wi96U2NLUUEvclVSUElKVVU9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGYk/FqbEVJcXM1aEVCWDRSU0M0N2JUeEZo/dWNTMmc5WmMycnViTE15L0RWSnpsek/9JMEp6VHVGVXB1UTM5L0VLRXNFOHBp/ajBHR1pEQWJJTzI5aUpPYzg9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGYS/93c20zK3NFSyszdnNmbDEyWFgwS05H/QTVhb1FBVnFtZUVrb3JKZ09ZaTFtVV/JoNHBtbks2R1YyS1o3R1ZVdGcwcGQ3/UWFESFFZNlFWZ1JrZHV4dzQ9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGY0/o1WGU2Y0NNV3d6V3A4WHVEZzJNa2tu/WUFmaC9rVXlHTmhDLzVWNlNjS2RWcU/FTdFJXemN6VjFwQmNQRmp0TXpvWkU2/a1RmTnZhajZkNnlzd1AzVnM9.jp