"insert into MasterData values ( '292','room','Vlašimská 1876/13','Prague','cz','64200','2017-08-23','1','EUR','Nabízíme Vám soukromý pokoj s rozlehlou soukromou koupelnou v komunitním domě Vila Flora. K dispozici je zde velká manželská postel, dvě pohovky (lze využít jako postele), malý stolek, velká šatní skříň a vstup do rozlehlé koupelny. Koupelna je vybavena velkou vanou, sprchovým koutem, dvěmi umyvadly, toaleou a bidetem. Jsou tam také umístěna dvě velká nástěnná zrcadla a úložný prostor. 
Z oken je výhled naši zahradu a domy v okolí. Další toaleta je jen pár kroků od pokoje. 

Budete mít k dispozici společnou kuchyň, kancelářské prostory, zahradu, knihovnu s obývacím pokojem během Vašeho pobytu.


O nemovitosti

Půvabná historická vila na nachází v klidné zelené čtvrti Prahy 10. Postavena byla spolkem spisovetelů v roce 1928. Za rohem si můžete podívat na dům jednoho z našich nejznámějších spisovatelů Karla Čapka. Od centra města se dostanete metrem nebo tramvají za 20 minut. 

Hosté naší vily mají přístup do vybavené kuchyně a jídelny, které jsou sdíleny. Kromě klasického kuchyňského vybavení můžete použít mixér, profesionální kuchyňský robot a spiralizér. 

Vila je obklopena permakulturní zahradou s množstvím květin, bylin a zelenin. Zahrada je pro vás otevřena pro relaxaci a odpočinek. 


Interakce s hosty 

Vila Flora je dům, kde žijí lidé, kteří touží po více harmonickém světě. Na chvíli se může stát součástí. inspirovat se a vychutnávat naše zdravé svačinky. Vždy je zde někdo, kdo Vám ochotně poskytne informace o Vile, okolí a Praze. 


Sousedství a praktické informace

Vila Flora se nachází v oblasti Vinohrady, kde můžete zažít skutečný život v Praze a setkání s místními obyvateli a zároveň jste velmi blízko centra města. Okolí Vily je velmi tiché, ale zárověň se během 5 minut chůze dostanete k hlavní ulici, kde najdete velké nákupní centrum, kavárny,  bary, restaurace všeho druhu: česká kuchyně, mezinárodní kuchyně, vegetariánské a veganské restaurace, farmářské trhy, útulné kavárny, kluby, alternativní hudební bary... 

Za rohem je autobosová zastávka směrem na Florenc. Tramvaje jezdí 5 minut chůze od vily a metro 7 minut, takže se do centra Prahy dostnete za 15 minut.

