"insert into MasterData values ( '299','flat','Trappelgasse','Vienna','at','183500','2017-05-24','1','EUR','This quiet one-bedroom apartment can be found in the part of Vienna called Nikolsdorf. 
While wandering the charming streets of Vienna you will certainly find a baroque palace Schönburg which is reachable only in five minutes.
A little further on is another baroque pearl - the Belvedere Palace, where you can go to see one of the interesting exhibitions.
If you are not interested in the largest collection of works by Gustav Klimt in the world, I'm sure you will enjoy beautiful gardens that surround the palace.
In the vicinity of the apartment you will find plenty of small parks, where you can relax or just stop and listen to the birds singing.
The location is easily accessible, in 10 minutes by walk you get to the underground line U1,  which is next to the Central Station.
Near the apartment you will also find the tram stop (1, 18, 62). Int he same street you will find grocers, bakers, post office, pharmacy or fitness studio. 
Evenings can be spent in restaurants, bars and cafes, or you can go for a culture theaters and museums.

The whole apartment is decorated in bright colors and that´s why looks very spacious and cozy.
From the hall you walk into the bedroom with a large double bed on which is falling the light from two large roof windows.
Before sleeping, you can watch the night sky or you can watch the TV, which stands on the table next to a comfortable sofa bed with armchair.
On the elevated stage you will discover a writing desk which can be used as a home office.
Bedroom adjoins a spacious and well-equipped kitchen. You can prepare a wonderful breakfast in the morning with a cup of good drip coffee.
Dinner you can cook on an electric stove with hood or just easily put it into the oven. Your gastronomic art you enjoy at the dinning table.
With the dirty dishes you can say goodbye, just simply stow them into the dishwasher! 
