"insert into MasterData values ( '312','flat','U Santošky 1110/5','Prague','cz','112900','2017-07-05','1','EUR','This attractive 3 bedrooms apartment has a terrific location right in the centre of Prague.The apartment is located next to the underground station Anděl (Angel) at underground line B . 
From the airport you can easily get to the apartments  by bus 191. From there its 3 min by walk.           
It has a 2 bedrooms with comfortable double beds - Queen size bed (160x200) and night tables, reading lamp,chest of drawers, and spacious wardrobe for your clothes , LCD TV. 
Living room with 2 pull out sofa bed, LCD TV, and a equipped kitchen (fridge, coffee maker, microwave, hot plates and electric kettle, cups, glases,toster cutlery and cooking utensils),dinner table and chairs.
Bathroom: shower, hairdryer, towels, washing machine,mirror,washbasin, toilet. 

It's just four minutes directly by metro to the Wenceslass Square. Seven minutes directly by tram is the Infant Jesus of Prague, the John Lennons Wall and the Kampa Island with the Charles Bridge. The Prague Castle is just 10 minutes by tram. Vyšehrad - the Pragues oldest castle is just three tram stops away (5 minutes). The Small Town Square is just 10 minutes directly by tram. 
There is a underground station Anděl (underground line B) just 300m . Ten tram lines and three night tram lines just 100 m from flat. 
