"insert into MasterData values ( '322','flat','Na Petřinách 9','Prague','cz','113300','2017-07-23','1','EUR','This modern apartment is located in Prague district Brevnov. Not far from it stands Brevnov Monastery, the oldest monastery in the Czech Republic, founded in 993. Monastery is surrounded by baroque garden with a Baroque pavilion, spring creek and Basilica of St. Margaret. There is also a monastic brewery where beer has been brewed since the 13th century. Parks Divoka Sarka and Obora Hvezda are close as well.
