Beautiful apartment of 63 square meters is located in the basement of beautiful historical building. The apartment is very spacious, it consists of one large room that is optically divided by smaller room with storage space. Once you enter the front door to the apartment, on your right you will discover a bedroom with a comfortable double bed. Windows illuminate a small table with chairs where you can lie back in the evening and watch your favorite show on television.
