You walk to two bedrooms across the long hallway. The door on the left will take you to the first one, where can sleep up to three people. Under the window there is a large double bed, next to the door you will also find a single bed. The second bedroom is drafted for two and besides double bed provides a comfortable sofa from which you can watch the television. The living room also fulfills functions of the kitchen and dining room. The kitchen is very well equipped. In the morning you heat a pan on a gas stove and cook scrambled eggs with few toasts from a toaster. You will enjoy the wonderful breakfast with a cup of coffee at the dining table or on the balcony with outdoor furniture. You can also prepare your meal in the oven. You don´t have to worry about the dirty dishes, just put it in the dishwasher!
From the hallway you also get to a bright spacious bathrooms with shower and double sink.

The price includes final cleaning and linen changes every 14 days. The owner can also arrange breakfast, one price for breakfast is 50 CZK.

Convince yourself thanks to our 3D virtual tour.','50.0849882','14.4462878','0','50000','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGZj/ErdjJES3Jmc0FiWXJvUUVrUzI5dFlK/SU1PQTFuUEZPeDQxNDE3TDMxQUs0aV/c0dGlPcW9EQ2hGRHh3UzlmbHRlWDFH/VjNTSjlYYUVMRlRvUjlXNEU9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGYm/k0SHhPbDZPQkg5emNVb0tLRXA2akhV/blRmUFdSWGVnQWxzSldEdmFkQTYzS2/RDNFkrTytxVDhCNHBTZ0Vjcjd1RTRa/amJaOVhGQXE0UUh6emJPejg9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGZD/JQS2lEMjArVkpEWU5ia2xuZWJDN2tZ/eGxFbGVBUXJrZXR6b3AzOVdqQUk5U3/pBbHlrRkNxanVDN1R5SEE0eitiZ2hP/cXV6MHhNMUJ0Q1AwMXM5NVk9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGUW/Vtdis2NEJpWEloWG1PTVZIQ0pwcjRt/WVdQbXNNaENxd21sZXZhSzFwbGNDeF/hSUUdia2lCR0tnUzBwYjc5SlRXNVc4/dmo3ckxoa0RIa1EwdnpaQWc9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGYm/IwRGttT3ZBcHhkWlBWNVZZaUoxT014/WGFPYVltMGVRRG1wOWJzT1RPb3Arbz/BHVkp2MVFlSE9kdnltUmp6bi9IcDhV/d2ZlbVVDOFhvLyt5NkxoWFE9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGVm/5WeDVsRU1LdmFpZkpiUVNXQTk5c0tB/RDhzTDJYdXNpS2YwejNBZWRqdnJoeD/doYTl0enNQK3VmbHA3SDJXMHZQY1Ji/OW45RXZuWnlHdHpOTk5Cd3c9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGUU/45NEExd0RlTjdsNXNwVzJ5dG45UU5J/cGY0WW1jVmtwVUFKRllSdEJDNUlyZD/hpSi9PQmJUY3JjTlVOcktDbmJTaG50/Y1FTa3JLdGRvT2NFcjRwK2c9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGU3/EyYTUzUzl3RGxBNlFlR1YyaGsyTFZ1/MVFCQ3RGTmRKdGNTMjFOWjRVZldCaV/lqNnd0dUxSaHNRczFKdXlvMHFBWFZT/amJzRlBuUThCNlFVc2RNK2c9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGVH/ZpblREVUlMVkRqczNNcCtFb2RsTkp2/ck5hd250cGJhUXYrQXZES2Z1Z1VxU2/VLc2VhbXRhUk1GL3BFT25UM2dxMlRO/VEQzZjhEMUhNbGlROEZKSHc9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGWX/JFKytYamYzaUJzV3o1a2c0M1ZoQWk2/aDFCN0V1NVVuK3JtY09tWmZZODM1R3/pFUU1jbXlKcElJZmRMS1NpaFk2NG14/RW1seXBTYlFiQ2Y2THllUU09.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGWl/NKR0E1Nm5ZQ