The dinning room leads into the bedroom, which is equipped with double bed, wardrobes and upon request it´s possible to add a baby cot (4-5 years).

The entrance to the balcony is next to the entrance to the apartment.
Access to the private part is through the gate. The apartment is heated by gas and electric heater, hot water is produced by electric boiler.
