"insert into MasterData values ( '351','flat','Karlovo náměstí 14','Prague','cz','181200','2017-09-01','1','EUR','Spacious apartment of 120 square meters is located in Prague district New Town with many sights. Directly under the house sprawls largest square in Europe - Charles Square, dominated by the New Town Hall. This Gothic building stands here since the reign of Charles IV. Around the house you will discover Baroque Church of St. Ignatius of Loyola and Temple of Saints Cyril and Methodius associated with moving story of Czech paratroopers during World War II. A 10-minute walk takes you to the Slavic island with Žofín Palace, to National Theatre or Wenceslas Square. On the bank of river Vltava stands modern Dancing House. You can also visit the shopping center Quadrio and buy something nice to wear.
Charles Square is a major traffic hub, so it is perfectly accessible by public transport. Within five minutes you walk to stop lines 1, 2, 3, 4, 5, 6, 9, 10, 11, 12, 14, 16, 18, 20, 22, 24, 25, 51, 52, 53, 54, 55 56, 57, 58 and 59, or bus stops 148, 176, 504 and 510. Yellow metro line B and red metro line C can be reached within 10 minutes.
In the neighborhood waits for your visit galleries, museums and theaters as well as restaurants, bars, cafes and wine bars. Supermarket is located in the same building, nearby are also ATMs, drugstores, pharmacies, hospital with emergency or any of Prague universities.

Apartment on the third floor of a building with elevator is really spacious. After all, there are enough beds for 11 people! Beds are placed into three bedrooms with parquet floors. Owner also equipped them with wardrobes, sofas, writing desk, linens and towels. In the apartment you will discover a living room with a balcony. You can sit here on a couch and watch your favorite movie on television.
Well equipped kitchen is decorated with bright colors. While cooking you will appreciate electric stove with kitchen hood, oven, microwave and toaster. You will enjoy the delicious food at large wooden table that stands in the hallway. You don´t have to worry about dirty dishes anymore, the kitchen is also equipped with a dishwasher.
White bathroom with washing machine offers a bathtub. First toilet is in the bathroom, second one is separate.

The apartment is suitable for 6 people at most.

See for yourself in our 3D virtual tour.

