insert into MasterData values ( '362','flat','','Prague','cz','98200','2018-01-01','1','EUR','Útulné studio č.10 v rezidenčním domě hotelového typu s příjemnou privátní atmosférou, nabízející krátkodobý i dlouhodobý pronájem v prostředí dobře udržovaného původního bytového činžovního domu z počátku 20. století. Nachází se na výhodném a dobře dostupném místě v těsné blízkosti klíčových dopravních uzlů Prahy 5, vedle velkého obchodního a administrativního centra Zlatý Anděl, kde jsou dostupné všechny druhy městské hromadné dopravy (PID) včetně bezprostřední blízkosti vstupu do metra. Dům nabízí dvoulůžková a jednolůžková studia (1+kk, 30m2) s možností přistýlky, situovaná cca na úrovni 2. patra, vybavená vším, co je potřeba při cestování, kratším či delším pobytu i stálém bydlení: kuchyňská linka včetně spotřebičů - sporák, lednice, mikrovlnka, koupelna s toaletními potřebami, WC, sprchovým koutem i vysoušečem vlasů. Každé studio má připojení Wi-Fi k internetu a LCD televizi. Na přání zákazníka lze zajistit každodenní úklid studia i další služby (praní, žehlení). Domácí zvířata jsou dovolena (pes, kočka). Dům je veden jako nekuřácký. Kuřácký dvorek v zadním traktu budovy je pro tento účel kdykoliv k dispozici.','50.0688104','14.4017142','0','50000','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGWH/M0eVo5cktrUGZsYVBDdTlCQmtiQStn/MlVRb1ZlNXUyQkd3OEFFKzhVUVRHZW/hyWHQwcytsT1FLS1E4ZStwSCtVRnpE/TGppWlNld0pSV1pWK1JHVXc9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGYV/JRYVlMNTJTWUdTK1JJNXVYcnYvNm5I/SmxZeDIxSDlVSkRjcExjWkRWN2R5NF/IwZnZpdmJnRlFNUnNDKzdrMHExd1dn/MGdPT28yVHcvTlF3aWxGc0U9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGU2/Q2WXZxczBMaHp4QkVwQXpndXdGTkI2/MWQ0MTEwdmtDeXlXNTdISW9EU05nTl/NUakJUdDk3aWhsU0JSUHplOXVVcWZ6/SlUrcC9VdGE1NzdmMkJRenM9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGU2/NGUThUWFZROFJheHp0WHJqeFBlSXBJ/U0g2amhnZTk5OTZ6em11OHhNbXdmVU/1rSUxlV1FHVmhqdjFGWGxsUld0cnVs/TTVWRlFPTCtsNDNwMC9YalU9.jp