"insert into MasterData values ( '367','flat','Karlovo náměstí 14','Prague','cz','207700','2017-09-01','1','EUR','Spacious apartment of 120 square meters is located in Prague district New Town with many sights. Directly under the house sprawls largest square in Europe - Charles Square, dominated by the New Town Hall. This Gothic building stands here since the reign of Charles IV. Around the house you will discover Baroque Church of St. Ignatius of Loyola and Temple of Saints Cyril and Methodius associated with moving story of Czech paratroopers during World War II. A 10-minute walk takes you to the Slavic island with Žofín Palace, to National Theatre or Wenceslas Square. On the bank of river Vltava stands modern Dancing House. You can also visit the shopping center Quadrio and buy something nice to wear.
Charles Square is a major traffic hub, so it is perfectly accessible by public transport. Within five minutes you walk to stop lines 1, 2, 3, 4, 5, 6, 9, 10, 11, 12, 14, 16, 18, 20, 22, 24, 25, 51, 52, 53, 54, 55 56, 57, 58 and 59, or bus stops 148, 176, 504 and 510. Yellow metro line B and red metro line C can be reached within 10 minutes.
In the neighborhood waits for your visit galleries, museums and theaters as well as restaurants, bars, cafes and wine bars. Supermarket is located in the same building, nearby are also ATMs, drugstores, pharmacies, hospital with emergency or any of Prague universities.

Renovated apartment is located on the second floor of a bulding with an elevator. It's really spacious, so you can choose in which bedroom are you staying. Beds are placed into three bedrooms with parquet floors. Owner also equipped them with wardrobes, sofa bed, dresser, linens and towels. Big screen television is waiting for you in the living room. You can watch it from the comfort of the sofa. Sunlight shines into the room through the glazed doors which leads you to the balkony. 
The kitchen is designed with a combination of white colour and wood. In the morning you fry scrambled eggs on the electric stove with kitchen hood. Lunch can be prepared in the oven, dinner can be heated up in the microwave. You will enjoy the delicious food at large table that stands in the hallway. And what about dirty dishes? You do not have to soak your hands in the sink, you can just put it into a dishwasher.
Bright bathroom with washing machine offers a bathtub. First toilet and a bidet are in the bathroom, second toilet is separate.

The apartment is suitable for 6 people at most.

