"insert into MasterData values ( '369','flat','Milady Horákové 322/10','Brno','cz','60400','2017-07-15','1','EUR','This one-bedroom apartment is located in the very center of Brno. After three minutes, you will reach Janáček's theater, which is surrounded by a pleasant park with a light fountain, whose shapes and colors are particularly impressive after nightfall. Gothic Church of St. George is a 7-minute walk away, as well as the Moravian Square with the Baroque Místodržitelský Palace, where you will find the Moravian Gallery today. There is also the popular Cinema Scala on the square, where you can enjoy not only films, but also lectures and discussions organized by Masaryk University.
The location is easily accessible by public transport. Tram stop of lines 1, 3, 5, 6 and 9 and night lines 90, 91, 92 and 93 is three minutes away. If you are traveling by car, you can park for free in front of the house.
Nearby you will find restaurants, cafes and bars as well as theaters, galleries, groceries, pharmacies or ATMs. The landlord also lives in the same house, so he can advise you where to go for a good coffee or beer.

