"insert into MasterData values ( '375','flat','Plzeňská 52','Prague','cz','59800','2018-01-01','1','EUR','This cozy one-bedroom apartment can be found in Smichov, Prague district that is located on the left bank of the river Vltava. Just five-minute walk from the apartment is park Husovy sady which leads to hill Černý vrch and provides great place for relaxation and sport. Within ten minutes of walking you can get to the neoclassical mansion Bertramka where Wolfgang Amadeus Mozart was staying for some time. Worth mentioning is also walking distance to the Kinsky gardens and Petřín tower - the smaller Czech version of the Eiffel Tower. 
The location is easily accessible by public transport. It takes only four minutes to get to the tram stop Bertramka, where stops more than ten different trams. For example the trams 1, 9, 15 and 25 which takes you to the city centre to Main train station or Malostranská station. Other trams go to Motol hospital, Barrandov or Vršovice. In ten minutes you walk to Anděl, metro station of line B. 

On the same street as apartment is also small market with long opening hours, church, ATM’s, restaurants or hairdressers. Ten minutes takes you to get to the shopping centre Nový Smíchov with all the services and shops. 
