"insert into MasterData values ( '382','flat','Vídeňská 18','Brno','cz','90600','2017-06-01','1','EUR','This beautiful apartment is located in a quiet area in district Brno-center. Nearby is the University Campus Bohunice with a shopping center OC Campus Square, which can be reached in 6 minutes. Along the way you pass Výstaviště, which hosts trade fairs, shows and exhibitions. You can take a break from the bustle of the city in Kamenná kolonie, which can be reached in 10 minutes. A charming area full of crooked streets and picturesque houses is popular by artists and bohemians in particular. You'll fall in love with a specific atmosphere of this place.
The location is easily accessible by public transport. In a minute you get to the trams 2, 5, 6, 8 and 10. When you cross the river Svratka, you will find yourself in the heart of Old Brno, Mendel Square. This is an important transport hub for trams, buses and trolley buses. Your can park your car conveniently in the garage.

