"insert into MasterData values ( '387','flat','Přípotoční 23','Prague','cz','52900','2017-11-12','2','EUR','Cozy apartment can be found in the Prague district Vršovice. Football fans will be thrilled by its location. 5 minutes walk takes you to the Stadion Bohemians 1905, in another direction stands Eden Arena, the home stadium of Slavia Praha, where you can also go to a concert. Near the apartment rises to the sky constructivist Church of St. Wenceslas by architect Josef Gočár. A 10-minute walk take you to Herold orchards, a little further are Havlicek vineyards with villa Gröbovka.
The location is easily accessible by public transport, in14 minutes you get to downtown. The trams 2, 4, 5, 6, 7, 13, 21, 22, 24, 52, 55, 57 and 59 are within 5 minutes walk, even closer stop buses 101 and 188. In vicinity is also Vršovice Train station.
In the neighborhood you will discover restaurants, cafes and bars as well as supermarkets, ATMs, post office or pharmacy.

One-bedroom apartment with the possibility of the balcony has a very good spatial resolution. The bed is raised to the ceiling and you get there by wooden stairs. Therefore there is enough space in the room for other furniture. There is also a comfortable sofa bed and desk, which serve well as a home office.
The kitchen is visually separated with shelves, which also serves as storage space for dishes. Although the kitchen is small, it serves well for daily use. It is equipped with an electric stove, microwave, fridge-freezer and a grill.
The bathroom decorated in white and orange colors come with a bathtub and a washing machine.

