insert into MasterData values ( '389','flat','Ostrovského 20','Prague','cz','98200','2018-01-01','1','EUR','Útulné studio č.6 v rezidenčním domě hotelového typu s příjemnou privátní atmosférou, nabízející krátkodobý i dlouhodobý pronájem v prostředí dobře udržovaného původního bytového činžovního domu z počátku 20. století. Nachází se na výhodném a dobře dostupném místě v těsné blízkosti klíčových dopravních uzlů Prahy 5, vedle velkého obchodního a administrativního centra Zlatý Anděl, kde jsou dostupné všechny druhy městské hromadné dopravy (PID) včetně bezprostřední blízkosti vstupu do metra. Dům nabízí dvoulůžková a jednolůžková studia (1+kk, 30m2) s možností přistýlky, situovaná cca na úrovni 2. patra, vybavená vším, co je potřeba při cestování, kratším či delším pobytu i stálém bydlení: kuchyňská linka včetně spotřebičů - sporák, lednice, mikrovlnka, koupelna s toaletními potřebami, WC, sprchovým koutem i vysoušečem vlasů. Každé studio má připojení Wi-Fi k internetu a LCD televizi. Na přání zákazníka lze zajistit každodenní úklid studia i další služby (praní, žehlení). Domácí zvířata jsou dovolena (pes, kočka). Dům je veden jako nekuřácký. Kuřácký dvorek v zadním traktu budovy je pro tento účel kdykoliv k dispozici.','50.0688104','14.4017142','0','50000','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGWm/pMS1ZIRFAyM2dLVGI2ekpZd3QwL0Zv/NkNmQ1pENU1Gb1FUa3RINE5OQVZpMD/hmR2RkSWNacFhMOHk0Nkh0b0ZScHpq/ZC9UVHlCQWp5OHVHdFRWdDg9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGYz/RoNXZxb1d1eVRkZ3VWUkZva05vc284/QllGcENjYk1IdFZOa3grTWl6OG9Sdk/lrNTVvRHN4UDRmTFhSOE1FNmNGZTJN/RXV6SXhMZlVTT0xYRUlqSjA9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGV2/9NTGYzaDUzRHJVRlJNMEdkTXVQOFBY/LzlNM0t0emdRVGlONEFuNlJoQWhOL0/UwakUxNHp0M0lFdlcwRnViNW1GaVR3/T05vUllWKzQrdVNSUkg2cFk9.jpg','https://app.flatio.com/thumb/Z1VYOS9vM2FTcHFLdS9vT3R3alhGVV/ErRzVzSUZ6M1ZmMEtmMUVPOXRaYnFj/VDNvbUh4Z3czQTc2ajRpQWV5cHAzTk/JNRVNVa1hWa09Vc042S1RCVjBhcnF3/Z2ptdGZZOWNGdW