"insert into MasterData values ( '390','flat','Pitterova 2855/13','Prague','cz','79300','2017-10-01','1','EUR',' The modern apartment is located in the Žižkov district, nearby the city center. Žižkov is often referred to as Montmartre in Prague, thanks to a number of restaurants, bars, galleries, cinemas and bistros where artists meet.
