"insert into MasterData values ( '391','flat','Máchova 19','Prague','cz','132200','2017-05-24','1','EUR','This beautiful and spacious apartment on the first floor of a newly renovated building can be found in the part of Prague called Vinohrady.
When wandering around you will certainly find Havlíčkovy orchards with villa Gröbe surrounded by vineyards, which offers a beautiful view of the most beautiful city in the Old Continent.
In less than 10 minutes by walk from the apartment you get to the Peace Square, dominated by a neo-Gothic Church of St. Ludmila. From here you will reach the historical center in a few minutes by the underground (A).
In the surroundings of the apartment you also find a tram stop (1, 4, 10, 16, 22, 51, 57, 59) or bus stop (135).
On your visit awaits restaurants, bars, cafes and wine bars. In the neighborhood you can also find ATMs, grocery and pharmacy, on a tournament of fantasy and sci-fi desk games you can jump into the nearby venue.
The eveningds can be spent in the cinema cafe.

Once you enter into this one bedroom apartment on the first floor, you will feel very comfortable atmosphere. 
This impression is supported by the bright colors in which is the apartment furnished, looks very spacious and airy.
The largest room in the apartment is a bedroom, where two large windows throw the light into the room.
Beneath them stands a comfortable sofa where you can watch satellite TV or evening news. Next to the large wardrobe you will find a double bed.
The door from the bedroom leads to the kitchen. Black and white kitchen unit hides a built-in appliances. Besides electric hob with a hood waiting for you also oven, microwave and dishwasher.
