"insert into MasterData values ( '399','flat','Pitterova 2855/13','Prague','cz','143500','2017-09-01','1','EUR','The modern apartment is located in the Žižkov district, nearby the city center. Žižkov is often referred to as Montmartre in Prague, thanks to a number of restaurants, bars, galleries, cinemas and bistros where artists meet.
The apartment is located directly at Olšanské cemeteries, where important Czech personalities such as Josef Jungman, Jan Werich and Jiří Voskovec, as well as actor and director Ladislav Smoljak are laid to rest. The park Parukářka is also worth a visit, you can relax here from the hurried life in the metropolis. A 15-minute walk will take you to the nearest supermarket, which is at the Atrium Flora Shopping Center. In the vicinity you will find a hospital, a post office, but also a sports center and a pharmacy.
Two minutes walk from the house there is a tram stop Nákladní nádraží Žižkov, from which leave ten tram connections. The nearest green metro station line A is two tram stops or a twenty minute walk away. The city center can be reached in twenty minutes by metro. The owner of the apartment also offers the possibility of renting a garage for 1 500 CZK per month.
The apartment is located in Central Park residential building, which consists of several houses. The project is a unique combination of greenery and buildings, a wide range of services and proximity to the center of Prague. All houses are connected to underground parking with storage space.

The apartment consist of two floors. The lower floor serves mainly as a hall. After taking the wooden stairs, you will find yourself in a spacious living room with a large sofa and a widescreen TV. Table and chairs form the divider between the living and kitchen part of the apartment. The kitchenette provides an induction stove, oven, dishwasher and, of course, all the utensils which you will appreciate after your friends arrive for dinner. The living room also has access to a larger terrace where you can grill or just relax and sunbathe.
